text382742.addInnerText('<div id=\"text382742\" aria-live=\"polite\" ><a id=\"text382742anc\" style=\"display:block;height:0px;width:0px;\"></a>\n<table style=\"border-collapse:collapse;top:0px;position:absolute; border-spacing:0; width:100%; height:100%\">\n<tr>\n<td style=\"position: absolute;top:0px;left:0px;box-sizing:border-box;width:100%;vertical-align:top;height:100%;padding:5px\">\n<div style=\'height:100%;width:100%;overflow-y:hidden;overflow-x:hidden;\'>\n\n<ul  style=\"list-style-position:outside;text-align:left;\" >\n<li  class=\"text382742Font3\" data-bltIndnt=\"0\" style=\"line-height:1.284;position:relative;margin-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text382742CircleBulletFont8.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text382742Font2\"  >​</span ><span class=\"text382742Font3\"  >Where possible, just avoid printing documents altogether. Instead use your accredited IT systems (like Objective), to view your documents. It\'s an easier and safer option.\n</span ></li >\n<li  class=\"text382742Font3\" data-bltIndnt=\"0\" style=\"line-height:1.229;position:relative;margin-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text382742CircleBulletFont8.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text382742Font3\"  >Keeping your records online makes your day easier because you don\'t need to:\n</span ></li >\n<ul  style=\"list-style-position:outside;text-align:left;\" >\n<li  class=\"text382742Font3\" data-bltIndnt=\"74\" style=\"line-height:1.229;position:relative;margin-left:90px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text382742CircleBulletFont8.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:74\n} --><span class=\"text382742Font3\"  >physically hold information that can be lost or stolen\n</span ></li >\n<li  class=\"text382742Font3\" data-bltIndnt=\"74\" style=\"line-height:1.229;position:relative;margin-left:90px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text382742CircleBulletFont8.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:74\n} --><span class=\"text382742Font3\"  >maintain a Classified Document Register\n</span ></li >\n<li  class=\"text382742Font3\" data-bltIndnt=\"74\" style=\"line-height:1.229;position:relative;margin-left:90px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text382742CircleBulletFont8.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:74\n} --><span class=\"text382742Font3\"  >conduct a regular file census\n</span ></li >\n<li  class=\"text382742Font3\" data-bltIndnt=\"74\" style=\"line-height:1.107;position:relative;margin-left:90px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text382742CircleBulletFont8.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:74\n} --><span class=\"text382742Font3\"  >maintain and administer costly security rooms and containers \n</span ></li >\n</ul >\n<p lang=\"en\"  legLH=\"1.107\" style=\"margin-left:0px;text-indent:0px;line-height:1.107;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text382742Font3\" style=\"background-color:transparent\" >\n&nbsp;</span ></p >\n<ul  style=\"list-style-position:outside;text-align:left;\" >\n<li  class=\"text382742Font3\" data-bltIndnt=\"0\" style=\"line-height:1.107;position:relative;margin-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text382742CircleBulletFont8.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text382742Font3\"  >Always ensure devices such as printers, are appropriately classified for what you want to do before you use it. If you are unsure, ask your Security Officer first. If you have used the wrong device, report it to your Security Officer immediately so that remedial action can be taken.&nbsp;\n</span ></li >\n<li  class=\"text382742Font4\" data-bltIndnt=\"0\" style=\"line-height:1.107;position:relative;margin-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text382742CircleBulletFont9.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text382742Font3\"  >If you have to print or photocopy a document, please remember to </span ><span class=\"text382742Font4\"  >retrieve it from the copier as soon as you can</span ><span class=\"text382742Font3\"  >. Do not leave it lying around for prying eyes to discover! \n</span ></li >\n</ul >\n</ul >\n\n\n</div></td>\n</tr>\n</table>\n</div>\n');
text382742.build()
